import React from 'react';
import Sidebar from '../components/Sidebar';
import { Routes, Route, Navigate } from 'react-router-dom';
import TreasurerPayments from './treasurer/TreasurerPayments';
import TreasurerFinances from './treasurer/TreasurerFinances';
import SocietyFinancesPage from './shared/SocietyFinancesPage'; // optional reuse

export default function TreasurerDashboard() {
  const links = [
    { to: '/treasurer/finances', name: 'Society Finances' },
    { to: '/treasurer/payments', name: 'Maintenance Fee Payments' },
  ];

  return (
    <div className="app-layout">
      <Sidebar links={links} />
      <div className="content">
        <Routes>
          <Route path="/" element={<h2>Welcome Treasurer</h2>} />
          <Route path="finances" element={<TreasurerFinances />} />
          <Route path="payments" element={<TreasurerPayments />} />
          <Route path="*" element={<Navigate to="/treasurer" replace />} />
        </Routes>
      </div>
    </div>
  );
}
